const BOOKLIST_API_BASE_URL ="http://localhost:8080/api/books";

class BookLisserviceFetch{
    getBookList(){
        return fetch(BOOKLIST_API_BASE_URL).then((response => response.json));
    }
}
export default new BookLisserviceFetch();
